By @lidyatjahjadi
Bahan :
1 kg daging sapi gandhik/lulur/kisi
Minyak goreng agak banyak

Bumbu ungkep :
2L air 
150gr gula merah
Seruas jari jahe
100 gram lengkuas potong2
2 batang sereh geprek
1 sdm ketumbar bubuk
7 siung bawang merah haluskan
5 siung bawang putih haluskan
5 lembar daun salam
Sedikit asam jawa
Garam dan gula sesuai selera

Cara Memasak :
* Rebus daging dengan bumbu ungkep dengan api kecil hingga empuk dan air berkurang
* Kulkas minimal semalam agar bumbu lebih meresap
* Goreng dalam minyak panas sebentar saya hanya sampai warna lebih gelap sedikit tidak sampai kering karena menggandung banyak gula cepet gosong. Angkat. Sajikan😊

